import data from "./data";

function App() {
  return (
    <div className="App">
      <header>
        <a href=" "> Drink Free </a>
      </header>
      <main>
        <h1>Lista de Produtos</h1>
        {
          data.products.map(product => (<div>
            <img src={product.image} alt={product.name}> </img>
            <p>
              {product.name}
            </p>
            <p>
              {product.price}
            </p>
          </div>))
        }
      </main>
    </div>
  );
}

export default App;
